  return (
    <Container>
      <div className="categories-body">
        {slug.map((res, i) => (
          <div key={i}>
            <Link to={`/${slug[i]}`}>
              <img src={`/${thumb[i]}`} alt={thumb[i]} />
            </Link>
          </div>
        ))}
      </div>
    </Container>
  );
}
